import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter } from 'react-router-dom'
import { ChakraProvider } from "@chakra-ui/react"
import { UserProvider } from './contextAPI/user';
import { LectureListProvider } from 'contextAPI/lecture';
import { ComicsListProvider } from 'contextAPI/comics';
import { EpisodeListProvider } from 'contextAPI/episode';
import { EpisodeImageProvider } from 'contextAPI/episodeImg';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <UserProvider>
        <LectureListProvider>
          <ComicsListProvider>
            <EpisodeListProvider>
              <EpisodeImageProvider>
                <ChakraProvider>
                  <App />
                </ChakraProvider>
              </EpisodeImageProvider>
            </EpisodeListProvider>
          </ComicsListProvider>
        </LectureListProvider>
      </UserProvider>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
